import axios from "axios";

const ApiRequest = {
  Session: {
    Login: (params) => {
      async (dispatch) => {
        try {
          axios
            .post('https://dev.perseo.tv/ws/Login.php', {
              params: {
                user: 'sdf',
                pass: 'dsf',
                device: 'web'
              },
              headers: {
                  'Accept': 'application/json',
                  'Content-Type': 'application/x-www-form-urlencoded',
              },
            })
            .then(res => {
              console.log(res);
              return res;              

            });
        } catch (err) {
          console.log(err)
        }
      };
    }
  }
}

export default ApiRequest;
